import './Nav.css';
import logo from '../../assets/logo.png';

function Nav() {
    return (
      <div id="Nav-container">
        <div id="Nav-wrapper" className='growable-child'>
            <div id="Nav-logo-wrapper">
                <img src={logo} />
            </div>
            <div id="Nav-search-wrapper" className='growable-child'>
                <div id="Nav-search-box">
                    Search
                </div>
            </div>
        </div>
      </div>
    );
  }

export default Nav;
